import React from "react";
import style from "./Contact.module.css"; // Asegúrate de importar tus estilos CSS

const SocialLinks = () => {
  return (
    <div className={style.linksContainer}>
      <a
        href="https://github.com/GMZ-Santiago"
        target="_blank"
        rel="noopener noreferrer"
        className={style.link}
      >
        <img
          src="https://1000logos.net/wp-content/uploads/2021/05/GitHub-logo.png"
          alt="GitHub"
          className={style.logo}
        />
      </a>
      <a
        href="https://www.linkedin.com/in/santiago-gomez-tartaglino-766a19268/"
        target="_blank"
        rel="noopener noreferrer"
        className={style.link}
      >
        <img
          src="https://1000marcas.net/wp-content/uploads/2020/01/Logo-Linkedin.png"
          alt="LinkedIn"
          className={style.logo}
        />
      </a>
      {/* Agrega más elementos aquí */}
      <a
        href="mailto:santugomezt@gmail.com"
        target="_blank"
        rel="noopener noreferrer"
        className={style.link}
      >
        <img
          src="https://ruta-hacia-la-imagen.com"
          alt="Otra Red Social"
          className={style.logo}
        />
      </a>
    </div>
  );
};

export default SocialLinks;
